import React from "react";

const Banner = () => {
  return (
    <div className="container d-flex">
      <div className="banner" style={{flex:3}} >
        <img
          src="https://samcenter.vn/images/uploaded/banner/2024/thang_6/tongdpc.png"
          alt=""
          width={100}
        />
      </div>
      <div className="banner_2" style={{flex:1}}>
        <div className="banner_top">
          <img src="https://samcenter.vn/images/uploaded/banner/2024/thang_6/tongdpc.png" />
        </div>
        <div className="banner_down">
          <img src="https://samcenter.vn/images/uploaded/banner/2024/thang_6/tongdpc.png" />
        </div>
      </div>
    </div>
  );
};

export default Banner;
